import React, { useEffect } from "react";
import { Table } from "react-bulma-components";
import axios from "../../utils/api";

function BookList() {
  const getBooks = async () => {
    try {
      const res = await axios.get("/books");
      console.log(res);
    } catch (e) {
      console.log(e);
    }
  };
  const book = {
    name: "Hermes Borba",
    age: 28,
    date: new Date(),
  };
  useEffect(() => {
    getBooks();
  }, []);

  return (
    <div>
      <Table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>idade</th>
            <th>Vacinação</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th>{book.name}</th>
            <th>{book.age}</th>
            <th>{book.date}</th>
          </tr>
        </tbody>
      </Table>
    </div>
  );
}

export default BookList;
